In C, an if/then statement is written as:

```c
if (condition) {
    // code to be executed if condition is true
} else {
    // code to be executed if condition is false
}
```

Here's a step-by-step guide to writing an if/then statement in C:

1. **Identify the condition**: Define a variable or expression that will be evaluated to determine whether the if statement should be executed. This is the condition that will be checked to see if the if statement should be executed.
2. **Check the condition**: Evaluate the condition using the logical operators AND, OR, and NOT. The condition should be evaluated as follows:
	* If the condition is true, the code inside the if block is executed.
	* If the condition is false, the code inside the else block is executed.
